import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Dashboard() {
  const [groceries, setGroceries] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      setError('‚ö† Please log in to see groceries.');
      return;
    }

    axios.get('http://localhost:5000/api/groceries', {
      headers: {
        Authorization: `Bearer ${token}`
      }
    })
    .then(res => setGroceries(res.data))
    .catch(err => {
      console.error(err);
      setError('‚ùå Failed to load groceries. Please log in again.');
    });
  }, []);

  if (error) {
    return <div className="p-6 text-red-600">{error}</div>;
  }

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">üõí Grocery Manager ‚Äî Dashboard</h1>
      {groceries.length === 0 ? (
        <p>No groceries found.</p>
      ) : (
        <ul className="space-y-2">
          {groceries.map(item => (
            <li key={item._id} className="p-3 bg-white shadow rounded">
              {item.name} ‚Äî ‚Çπ{item.price}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Dashboard;
